sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
 var pAddress=inputs.inputRequest.proposerInfos.prmntAddress;
    var cAddress=inputs.inputRequest.proposerInfos.comunctnAddress;

    var permanentAddress={
      addressdetails: {
        "state":pAddress.state,
        "houseno":pAddress.line1,
        "pincode": pAddress.pincode,
        "street": pAddress.line2 +" "+ pAddress.line3,
        "country": pAddress.country,
        "landmark": pAddress.landmark,
        "city": pAddress.city
        // ,
        //  "cityothers":pAddress.cityothers,
        // "stateothers":pAddress.stateothers
      },
      addresstype:"ADD_PMNT"
    }
    
    if(cAddress){
var communicationAddress={
        addressdetails:{
          "state":cAddress.state,
          "houseno":cAddress.line1,
          "pincode": cAddress.pincode,
          "street": cAddress.line2 +" "+ cAddress.line3,
          "country": cAddress.country,
          "landmark": cAddress.landmark,
          "city": cAddress.city,
           "cityothers":cAddress.cityothers,
        "stateothers":cAddress.stateothers
        },
        addresstype:"ADD_CORSP"
    }
    }
    if(cAddress.state=="" || !cAddress.state){
      delete communicationAddress.addressdetails["state"]
      delete communicationAddress.addressdetails["city"]
    }

    if(cAddress.stateothers=="" || !cAddress.stateothers){
      delete communicationAddress.addressdetails["stateothers"]
      delete communicationAddress.addressdetails["cityothers"]
    }

    var addressArray=[];
    addressArray.push(permanentAddress);

    if(!(cAddress !== 'undefined' || cAddress !== null)) {
      permanentAddress.sameastype = "ADD_CORSP";
    }
    else {
      addressArray.push(communicationAddress);
    }
    outputs.address=JSON.stringify(addressArray);

    addressArray.forEach(function(address){
      address.sameasparty="PROP_1";
    })
    outputs.ph_address=JSON.stringify(addressArray);

})(inputs, outputs);

